import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";
import CreateArea from './CreateArea';

function App() {
    return (<div>
        <Header />
        <CreateArea />    
        {notes.map(notes, index =>
            <Note
                title={notes.title}
                content={notes.content}
                key={index}>
            </Note>)}
        <Footer />
    </div>
    )}

export default App;
